from math import gcd
import sys
sys.setrecursionlimit(10000000) #Enlarge maximum recursion depth 

def Exgcd(a: int, b: int):
    '''
            gcd(a,b)=ax+by
    '''
    if (not b):
        return [1, 0]
    x, y = Exgcd(b, a % b)
    return [y, x - a // b * y]


def pinbow(a: int, b: int, m: int):
        '''
                return a^b mod m
        '''
        a %= m
        res = 1
        while (b > 0):
                '''
                        当b的当前二进制最低位为1时，即对应着二进制指数不为0时的Xi时
                                平方模m
                '''
                if (b & 1): 
                        res = res * a % m
                a = a * a % m
                b >>= 1
        return res


def Decrypt(c: int, e: int, p: int,q: int):
        '''
                c is the Ciphertext
                N = pq
                \psi_n = (p-1)(q-1)
                The output = c^{e^{-1}} \bmod N
        '''
        N = p*q
        Psi_n = (p - 1) * (q - 1)
        # print(Psi_n)
        e_inverse = Exgcd(e, Psi_n)[0] % Psi_n
        # print(e_inverse)
        return pinbow(c, e_inverse, N)
        # return pow(c, e_inverse, N)


